import React from "react";
import TodoItem from "./todoItem";
import todosData from "./todosData";

function Main() {
	let todoDataComponents = todosData.map((task) => {
<TodoItem key={task.id} tData={task} />;
	});

	return (
		<div className='main'>
			<div className='todo-list'>{todoDataComponents}</div>
		</div>
	);
}

export default Main;
